import React from 'react';

const ResultCard = ({ result, onClick }) => {
  const { name, price, star_number, soles_number } = result._source;
  return (
    <div className="resultCard" onClick={onClick}>
      <h3>{name}</h3>
      <p>{price}</p>
      <p>{star_number ? `${star_number} estrellas` : `${soles_number} soles`}</p>
    </div>
  );
};

export default ResultCard;
